export default function Form({ }) {
    function handleOnChange(ev) {
        console(ev)
    }
    return (
        <div className="form-div">
            <form>
                <input type="text" onChange={handleOnChange} />
                <input type="text" />
                <input type="submit" />
            </form>
        </div>
    )
}
